resources:
  groups:
    rdo-deps-core:
      description: 'Core members for RDO Dependencies projects'
      members:
      - admin@review.rdoproject.org
      - alan.pevec@redhat.com
      - amoralej@redhat.com
      - jcapitao@redhat.com
      - jpena@redhat.com
      - ykarel@redhat.com
      - kkula@redhat.com
  acls:
    rdo-deps-default:
      file: |
        [access "refs/*"]
          owner = group rdo-deps-core
        [access "refs/heads/*"]
            label-Code-Review = -2..+2 group rdo-deps-core
            label-Verified = -2..+2 group rdo-deps-core
            label-Workflow = -1..+0 group Registered Users
            label-Workflow = -1..+1 group rdo-deps-core
            submit = group rdo-deps-core
            read = group rdo-deps-core
            read = group Registered Users
        [access "refs/meta/config"]
            read = group rdo-deps-core
            read = group Registered Users
        [receive]
            requireChangeId = true
        [submit]
            mergeContent = false
            action = rebase if necessary
      groups:
      - rdo-deps-core
  repos:
    deps/ansible-collection-ansible-netcommon:
      acl: rdo-deps-default
      default-branch: c9s-caracal-rdo
      branches:
        c9s-yoga-rdo: c9s-xena-rdo
        c9s-zed-rdo: c9s-yoga-rdo
        c9s-antelope-rdo: c9s-zed-rdo
        c9s-bobcat-rdo: c9s-antelope-rdo
        c9s-caracal-rdo: c9s-bobcat-rdo
